import { Component, OnInit, Input, Output, EventEmitter } from '@angular/core';

@Component({
  selector: 'button-base',
  templateUrl: './button-base.component.html',
  styleUrls: ['./button-base.component.sass'],
})
export class ButtonBaseComponent implements OnInit {
  @Input() label: string = 'Base Button';
  @Input() bgColor: string = 'main';
  @Input() bgColorHover: string = 'transparent';
  @Input() textColor: string = 'white';
  @Input() borderColor: string = 'main';
  @Input() rounded: boolean = true;

  constructor() {}

  ngOnInit(): void {}
}

import { Component, OnInit } from '@angular/core';
import { mockUser } from 'src/app/data/mocks/user';
import { solidAppInfo } from 'src/app/data/solids/solidAppInfo';
import { solidNavHeaderHome } from 'src/app/data/solids/solidNavHeaderHome';
@Component({
  selector: 'app-layout-home',
  templateUrl: './layout-home.component.html',
  styleUrls: ['./layout-home.component.sass'],
})
export class LayoutHomeComponent implements OnInit {
  user: any = {};
  navs: any = solidNavHeaderHome;
  logoUrl: string = solidAppInfo.logoUrl;

  constructor() {}

  ngOnInit(): void {
    this.getUser();
  }

  getUser() {
    this.user = mockUser;
  }
}

