import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { ButtonBaseComponent } from './buttons/button-base/button-base.component';
@NgModule({
  declarations: [AppComponent, ButtonBaseComponent],
  imports: [BrowserModule, AppRoutingModule],
  providers: [],
  bootstrap: [AppComponent],
})
export class AppModule {}

import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

const routes: Routes = [
  {
    path: '',
    loadChildren: () =>
      "import('./layouts/layout-home/layout-home.module').then(\
        (m) => m.LayoutHomeModule\
      )",
  },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule],
})
export class AppRoutingModule {}

//#region Modules
import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { RouterModule } from '@angular/router';
//#endregion

//#region Pages
import { PageHomeComponent } from 'src/app/pages/page-home/page-home.component';
//#endregion

//#region Partials
import { PartialHeaderHomeComponent } from 'src/app/partials/partial-header-home/partial-header-home.component';
import { PartialFooterHomeComponent } from 'src/app/partials/partial-footer-home/partial-footer-home.component';
//#endregion

import { LayoutHomeRoutingModule } from './layout-home-routing.module';
import { LayoutHomeComponent } from './layout-home.component';

@NgModule({
  declarations: [
    LayoutHomeComponent,
    PageHomeComponent,
    PartialHeaderHomeComponent,
    PartialFooterHomeComponent,
  ],
  imports: [CommonModule, LayoutHomeRoutingModule, RouterModule],
})
export class LayoutHomeModule {}

import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { LayoutHomeComponent } from './layout-home.component';
import { PageHomeComponent } from 'src/app/pages/page-home/page-home.component';
const routes: Routes = [
  {
    path: '',
    component: LayoutHomeComponent,
    children: [
      {
        path: '',
        component: PageHomeComponent,
      },
    ],
  },
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule],
})
export class LayoutHomeRoutingModule {}

